import "./Menu.css";

function Menu() {
  return (
    // 인라인 스타일은 객체 형태로 사용합니다.
    <ul
      className="newClass"
      style={{ backgroundColor: "black", color: "yellow" }}
    >
      {/* class 속성은 calssName으로 표기 */}
      <li>짜장면</li>
      <li>짬뽕</li>
      <li>탕수육</li>
    </ul>
  );
}

export default Menu;
